function ImageComponent() {
  return (
    <div className="image-component">
      <img
        src="https://cdn.midjourney.com/bf7f0c44-922f-4d7e-bf73-b8396f00ebd8/0_3.png"
        alt="Sample Image"
        className="image"
      />
    </div>
  );
}

